import React, { useState } from 'react';
import { fetchDriverResults } from '../api';

const GrandPrixDetails = ({ grandPrix, onGoBack }) => {
  const [expandedSession, setExpandedSession] = useState(null);
  const [driverResults, setDriverResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleSessionClick = async (sessionType) => {
    if (expandedSession === sessionType) {
      setExpandedSession(null);
    } else {
      setExpandedSession(sessionType);
      setLoading(true);
      setError(null);
      setDriverResults([]);

      try {
        const results = await fetchDriverResults(grandPrix.name, sessionType);
        setDriverResults(results);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    }
  };

  const isQualificationSession = expandedSession === 'Qualifying' || expandedSession === 'Sprint Qualifying';
  const isRaceSession = expandedSession === 'Grand Prix' || expandedSession === 'Sprint';

  return (
    <div className="grand-prix-details">
      <h2>{grandPrix.name}</h2>
      {grandPrix.events.map((event, index) => (
        <div key={index} className="session-container">
          <button
            onClick={() => handleSessionClick(event.type)}
            className="session-button"
          >
            {event.type}: {event.date} at {event.time} {expandedSession === event.type ? '▲' : '▼'}
          </button>
          {expandedSession === event.type && (
            <div className="session-results">
              {loading ? (
                <p>Loading results...</p>
              ) : error ? (
                <p className="error-message">Error: {error}</p>
              ) : driverResults.length > 0 ? (
                <table className="results-table">
                  <thead>
                    <tr>
                      <th>Pos</th>
                      <th>No</th>
                      <th>Driver</th>
                      <th>Team</th>
                      {isQualificationSession ? (
                        <>
                          <th>Q1</th>
                          <th>Q2</th>
                          <th>Q3</th>
                        </>
                      ) : (
                        <>
                          <th>Time</th>
                          {isRaceSession && <th>Gap</th>}
                          <th>Laps</th>
                        </>
                      )}
                    </tr>
                  </thead>
                  <tbody>
                    {driverResults.map((result, idx) => (
                      <tr key={idx}>
                        <td>{result.pos}</td>
                        <td>{result.no}</td>
                        <td>{result.driver}</td>
                        <td>{result.car}</td>
                        {isQualificationSession ? (
                          <>
                            <td>{result.time?.q1 || '-'}</td>
                            <td>{result.time?.q2 || '-'}</td>
                            <td>{result.time?.q3 || '-'}</td>
                          </>
                        ) : (
                          <>
                            <td>{result.time || '-'}</td>
                            {isRaceSession && <td>{result.gap || '-'}</td>}
                            <td>{result.laps || '-'}</td>
                          </>
                        )}
                      </tr>
                    ))}
                  </tbody>
                </table>
              ) : (
                <p className="no-results">No results available for this session</p>
              )}
            </div>
          )}
        </div>
      ))}
      <button onClick={onGoBack} className="go-back-button">
        Go back
      </button>
    </div>
  );
};

export default GrandPrixDetails;
